template <typename It>
void PrintRange(It range_begin, It range_end) {
    for (auto it = range_begin; it != range_end; ++it) {
        cout << *it << " "s;
    }
    cout << endl;
}

template <typename It>
auto MakeSet(It range_begin, It range_end) {
    return set(range_begin, range_end);
}

template <typename It>
auto MakeVector(It range_begin, It range_end){
    return vector(range_begin, range_end);
}

template <typename Container, typename IteratorType>
void EraseAndPrint(Container& con, IteratorType start_) {
    auto it_erase = con.erase(std::next(con.begin(), start_));
    PrintRange(con.begin(), it_erase);
    PrintRange(it_erase, con.end());
}

