#include <bits/stdc++.h>
using namespace std;

struct Cow{
	int arrive, milk_time;
};

bool asc_arrive(Cow a, Cow b){
	if(a.arrive == b.arrive){
		return a.milk_time < b.milk_time;
	}
	return a.arrive < b.arrive;
}

int main(){
	ifstream fin("milkqueue.in");
	
	int N;
	fin >> N;
	
	vector<Cow> cows(N);
	for(int i = 0; i<N; i++){
		int a, m;
		fin >> a >> m;
		
		cows[i].arrive = a;
		cows[i].milk_time = m;
	}
	
	sort(cows.begin(), cows.end(), asc_arrive);
	
	int curr_time = 0;
	for(int i = 0; i<N; i++){
		//cout << "arrive: " << cows[i].arrive << ", milk_time: " << cows[i].milk_time << endl;
		if(cows[i].arrive > curr_time){
			curr_time = cows[i].arrive;
		}
		curr_time += cows[i].milk_time;
	}
	cout << curr_time << endl;
}

#include <bits/stdc++.h>
using namespace std;

struct Squirrel{
	bool start;
	int hr, min;
};

struct Time{
	int hr, min, tot;
};

bool asc_sq(Squirrel a, Squirrel b){
	if(a.hr == b.hr){
		return a.min < b.min;
	}
	return a.hr < b.hr;
}

int main(){
	ifstream fin("springcleaning.in");
	
	int N, NL; 
	fin >> N >> NL;
	
	vector<vector<Squirrel>> squ(N);
	
	for(int i = 0; i<NL; i++){
		int a, h, m; string s;
		fin >> a >> s >> h >> m;
		a--;
		squ[a].push_back({(s == "START"), h, m});
	}
	
	for(int i = 0; i<N; i++){
		sort(squ[i].begin(), squ[i].end(), asc_sq);
	}
	
	vector<Time> ans(N);
	for(int i = 0; i<N; i++){
		int away, now;
		for(int j = 0; j<squ[i].size(); j++){
			int mins = ((squ[i][j].hr)*60) + squ[i][j].min;;
			if(squ[i][j].start){
				away = mins;
			}else{
				now = mins;
				ans[i].tot += now - away;
			}
		}
	}
	
	for(int i = 0; i<N; i++){
		ans[i].hr = ans[i].tot/60;
		ans[i].min += ans[i].tot%60;
		cout << ans[i].hr << " " << ans[i].min << endl;
	}
}

#include <bits/stdc++.h>
using namespace std;

bool even(int a){
	if(a % 2 == 0){
		return 1;
	}else{
		return 0;
	}
}

int main(){
	ifstream fin("mathexpression.in");
	
	int N;
	fin >> N;
	
	vector<vector<int>> sb(7);
	vector<int> letter = {'S', 'O', 'M', 'E', 'B', 'I', 'G'};
	for(int i = 0; i<N; i++){
		int a; char c;
		fin >> c >> a;
		for(int j = 0; j<7; j++){
			if(letter[j] == c){
				sb[j].push_back(a);
			}
		}
	}
	
	int ans = 0;
	for(int i = 0; i<sb[0].size(); i++){
		for(int j = 0; j<sb[1].size(); j++){
			for(int k = 0; k<sb[2].size(); k++){
				for(int l = 0; l<sb[3].size(); l++){
					for(int m = 0; m<sb[4].size(); m++){
						for(int n = 0; n<sb[5].size(); n++){
							for(int p = 0; p<sb[6].size(); p++){
								int expr = (sb[0][i]+sb[2][k]+sb[0][i])*(sb[0][i]+sb[5][n]+sb[0][i]+sb[4][m]+sb[3][l]+sb[3][l])*(sb[3][l]+sb[6][p]+sb[1][j]+sb[0][i]);
								if(even(expr)){
									ans++;
								}
							}
						}
					}
				}
			}
		}
	}
	cout << ans << endl;
}

